import React, { useEffect, useState, useCallback } from 'react';
import "./Admin.css";
import { useAuth } from "../Auth/Store_Token/Utils_Token";

const AdminDashboard = () => {
  const { Authorization } = useAuth();
  const [users, setUsers] = useState([]);
  const [contacts, setContacts] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);
  const [updateData, setUpdateData] = useState({});

  const fetchAllUsers = useCallback(async () => {
    try {
      const response = await fetch('http://localhost:5000/api/admin/users', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': Authorization 
        }
      });
      const users = await response.json();
      if (response.ok) {
        setUsers(users);
      } else {
        console.error(users.message);
      }
    } catch (error) {
      console.error('Error fetching users:', error);
    }
  }, [Authorization]);

  const fetchAllContactData = useCallback(async () => {
    try {
      const response = await fetch('http://localhost:5000/api/admin/contact', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': Authorization
        }
      });
      const contacts = await response.json();
      if (response.ok) {
        setContacts(contacts);
      } else {
        console.error(contacts.message);
      }
    } catch (error) {
      console.error('Error fetching contact data:', error);
    }
  }, [Authorization]);

  useEffect(() => {
    fetchAllUsers();
    fetchAllContactData();
  }, [fetchAllUsers, fetchAllContactData]);

  const handleUpdateUser = async (userId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/admin/users/update/${userId}`, {
        method: 'PATCH',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': Authorization 
        },
        body: JSON.stringify(updateData)
      });
      const result = await response.json();
      if (response.ok) {
        console.log('User updated:', result);
        fetchAllUsers();
      } else {
        console.error(result.message);
      }
    } catch (error) {
      console.error(`Error updating user with ID ${userId}:`, error);
    }
  };

  const handleDeleteUser = async (userId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/admin/users/${userId}`, {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': Authorization 
        }
      });
      const result = await response.json();
      if (response.ok) {
        console.log('User deleted:', result.message);
        fetchAllUsers();
      } else {
        console.error(result.message);
      }
    } catch (error) {
      console.error(`Error deleting user with ID ${userId}:`, error);
    }
  };

  const handleDeleteContact = async (contactId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/admin/contact/${contactId}`, {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': Authorization 
        }
      });
      const result = await response.json();
      if (response.ok) {
        console.log('Contact deleted:', result.message);
        fetchAllContactData();
      } else {
        console.error(result.message);
      }
    } catch (error) {
      console.error(`Error deleting contact with ID ${contactId}:`, error);
    }
  };

  const handleInputChange = (e) => {
    setUpdateData({
      ...updateData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <section>
        <h2>Users</h2>
        {users.map(user => (
          <div key={user._id}>
            <p>{user.name} - {user.email}</p>
            <button onClick={() => setSelectedUser(user)}>Edit</button>
            <button onClick={() => handleDeleteUser(user._id)}>Delete</button>
          </div>
        ))}
      </section>
      {selectedUser && (
        <section>
          <h2>Edit User</h2>
          <input
            type="text"
            name="name"
            placeholder="Name"
            defaultValue={selectedUser.name}
            onChange={handleInputChange}
          />
          <input
            type="email"
            name="email"
            placeholder="Email"
            defaultValue={selectedUser.email}
            onChange={handleInputChange}
          />
          <button onClick={() => handleUpdateUser(selectedUser._id)}>Update User</button>
        </section>
      )}
      <section>
        <h2>Contacts</h2>
        {contacts.map(contact => (
          <div key={contact._id}>
            <p>{contact.name} - {contact.email}</p>
            <button onClick={() => handleDeleteContact(contact._id)}>Delete</button>
          </div>
        ))}
      </section>
    </div>
  );
};

export default AdminDashboard;
